  `accepted_terms` tinyint(1) DEFAULT '0',
  `created_at` datetime NOT NULL,
  `updated_at` datetime NOT NULL,
  `email_verified` tinyint(1) DEFAULT '0',
  `language` varchar(255) DEFAULT 'default',
  `reset_digest` varchar(255) DEFAULT NULL,
  `reset_sent_at` datetime DEFAULT NULL,
  `activation_digest` varchar(255) DEFAULT NULL,
  `activated_at` datetime DEFAULT NULL,
  `deleted` tinyint(1) NOT NULL DEFAULT '0',
  `role_id` bigint DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `index_users_on_password_digest` (`password_digest`),
  KEY `index_users_on_room_id` (`room_id`),
  KEY `index_users_on_email` (`email`),
  KEY `index_users_on_provider` (`provider`),
  KEY `index_users_on_created_at` (`created_at`),
  KEY `index_users_on_deleted` (`deleted`),
  KEY `index_users_on_role_id` (`role_id`)
) ENGINE=InnoDB AUTO_INCREMENT=233 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
